import React from 'react';
import CategoryButton from './CategoryButton'
import { FaPercent} from 'react-icons/fa'
import { GiMeal, GiThreeLeaves, GiFrenchFries, GiIceCreamCone, GiDrinkMe } from 'react-icons/gi'

const MenuHeader = () => {
    return (
        <div className='container'>
            <CategoryButton
                name='Deals'
                icon= {<FaPercent size={30}/>}
            />
            <CategoryButton
                name='Entrees'
                icon= {<GiMeal />}
            />
            <CategoryButton
                name='Salads'
                icon= {<GiThreeLeaves />}
            />
            <CategoryButton
                name='Sides'
                icon= {<GiFrenchFries />}
            />
            <CategoryButton
                name='Dessert'
                icon= {<GiIceCreamCone />}
            />
            <CategoryButton
                name='Drinks'
                icon= {<GiDrinkMe />}
            />

        </div>
    );
};

export default MenuHeader;
